    margin:0;
}


.board, .imgclass, .search{
float:left;
width:128px;
height:128px;
resize: inherit;
overflow:hidden;
background-color:transparent;
user-select: none; 
z-index:9999;
border:0;

font-family: 'Quicksand', sans-serif;
margin:0;
cursor:pointer;
box-shadow: inset 0 0 0 rgba(0,0,0,.5), inset 0 0 0 rgba(0,0,0,.5);
}

textarea{
    z-index:999999;
    font-size:12px;
    width:120px;
    height:120px;
    margin:0;
    padding:4px;
     cursor:text;
     border:0;
     color:rgba(255,255,255,.8);

    scrollbar-width: thin;
     background-color:transparent;
     font-family: 'Quicksand', sans-serif;
}
textarea::-webkit-scrollbar-thumb {
  background: rgba(255,255,255,.5);
  box-shadow: 0 2px 4px rgba(0,0,0,.5);
  cursor:pointer;
}
textarea::-webkit-scrollbar-thumb:hover{
  box-shadow: 0 0 0 rgba(0,0,0,.5);
  cursor:pointer;
}
.imgclass{

    opacity:0;
    height:100%;width:100%;
}


.metabox{
    font-size:11px;
    line-height: 14px;
}
#originText{
    width:50%;
    height:auto;
}

.outlink{
    color:black;
    display:inline-block;
    cursor:pointer;
    height:210px;
    width:130px;
    font-family:Piazzolla;
    font-size:11px;
    letter-spacing: 2px;
    text-align:center;
    margin:0 10px;
    padding: 0 20px;
    transition: all .1s ease-in-out;
    border-radius:10px;
    border:0 white solid;
}   

.outlink img{
  text-align:center;
  display:inline;
}
.outlink p{
    display:inline-block;
    color:black;
    transition: all .1s ease-in-out;
}
.outlink:hover{
    box-shadow:0 10px 60px 0 rgba(1,1,1,.1);
}
.outlink:hover p{
    opacity:.5;
    margin-top:5px;
}



#quitter{
background-image:url('https://static.thenounproject.com/png/1890872-200.png');
border-radius: 0  0  0  10px;
right:0;
position:absolute;
}

#door{
    z-index:9999999;
text-align:center;
display:inline-block;
font-family:Piazzolla;
letter-spacing:30px;
margin-top:30vh;
font-size:100px;
font-weight: 100;
transition: all .3s ease-in-out;
color:#616161;
cursor:pointer;
}
#door:hover, #door:hover b, #door:hover i{
  color:black; 
}


#door:hover{
    letter-spacing:60px;
}
b, i{
    color:#616161;
    font-family:Georgia;
}

.btn{
    transition: all .2s ease-out;
    position:absolute;z-index:99999999999;
height:64px; width:64px; 
background-size:60%; background-repeat:no-repeat; background-position:center;
box-shadow:0 0 15px 5px rgba(1,1,1,.1);
cursor:pointer;
opacity:1; 
text-align:left;
  word-break: break-word;
margin:0;
font-size:10px;
color:black;
box-shadow: inset 0 0 0 rgba(0,0,0,.5), inset 0 0 0 rgba(0,0,0,.5);
border:dashed 2px rgba(0,0,0,.2);
box-sizing: border-box;
background-color:#cbd0d6;
}
.menubtn{
    float:left;
    position:relative;
    margin:2px 10px;
}
video{
    height: 100%;
